import React, { Component } from 'react';

class ListFlight extends Component {
    render() {
        return (
            <div>
                <p>{ this.props.departureIataCode }</p>
                <p>{ this.props.arrivalIataCode }</p>
                <p>{ this.props.airline }</p>
                {this.props.airline == 'Batik Air' && 
                    <p>Harga: { this.props.estimasi_harga_batik }</p>
                }
                {this.props.airline == 'Citilink' && 
                    <p>Harga: { this.props.estimasi_harga_citilink } </p> 
                }
                {this.props.airline == 'Garuda Indonesia' && 
                    <p>Harga: { this.props.estimasi_harga_garuda } </p> 
                }
                {this.props.airline == 'Lion Air' && 
                    <p>Harga: { this.props.estimasi_harga_lion } </p> 
                }
                {this.props.airline == 'Sriwijaya Air' && 
                    <p>Harga: { this.props.estimasi_harga_sriwijaya } </p> 
                }
                {((this.props.airline != 'Sriwijaya Air') &&  (this.props.airline != 'Batik Air') && (this.props.airline != 'Citilink') && (this.props.airline != 'Garuda Indonesia') && (this.props.airline != 'Lion Air')) &&
                 <p>Harga: { this.props.estimasi_harga_lain }</p> }
                <div className="text-right">
                    <a href="#">Baca selengkapnya...</a>
                </div>
                <hr/>
            </div>
        )
    }
}

export default ListFlight;
